import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import {connect} from 'react-redux'
import {getSinglePull} from './../../../actions/repo.actions';
import {getPull} from './../../../reducers/repo.reducer'
import PullAcceptButton from './components/acceptButton';
import PullDenyButton from './components/denyButton';
import FilesChanged from './components/filesChanged';

class PullPage extends Component {
  constructor(props){
    super(props)
    this.props.dispatch(getSinglePull(this.props.match.params.id));
  }
  render() {
    console.log("these props hopefully", this.props)
    return (
      <div className="RepoPullPage">
        <Paper className="RepoPullPagePaper" elevation={0}>
          <div className="PullTitle">
            <a href="/repo"><h2>{this.props.match.params.repo}</h2></a>
            <h2 className="separator">/</h2>
            <h2>PullName</h2>
          </div>
          <div className="PullInfo">
            <div className="PullHeader">
              <div className="PullAuthor">
                <p>Author:</p>
                <a href="/user">Username</a>
              </div>
              <div className="PullActions">
                <PullAcceptButton/>
                <PullDenyButton/>
              </div>
            </div>
            <div className="files">
              <h4>Changes</h4>
              <FilesChanged/>
            </div>
          </div>
        </Paper>
      </div>
    );
  }
}

const mapStateToProps = (state)=>{
  return{
    pull: getPull(state)
  }
}

export default connect(mapStateToProps)(PullPage);
